INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 2, 2002, "2023/12/22 14:59:59", 10005, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", "リンド", 2, 0.0, "2023/09/15 15:00:00", 127702, 1, 0.0, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 2, 2002, "2023/12/22 14:59:59", 10006, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", "リンド", 2, 0.0, "2023/09/15 15:00:00", 127702, 2, 0.0, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 2, 2002, "2023/12/22 14:59:59", 10007, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", "ヴルム", 1, 0.0, "2023/09/15 15:00:00", 127802, 1, 0.0, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 2, 2002, "2023/12/22 14:59:59", 10008, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", "ヴルム", 2, 0.0, "2023/09/15 15:00:00", 127802, 2, 6.5, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 3, 2002, "2024/03/22 14:59:59", 10009, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", "アネモネ", 2, 0.0, "2023/12/15 15:00:00", 129602, 1, 0.0, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 3, 2002, "2024/03/22 14:59:59", 10010, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", "アネモネ", 2, 0.0, "2023/12/15 15:00:00", 129602, 2, 0.0, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 3, 2002, "2024/03/22 14:59:59", 10011, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", "ネフィ=ネラ", 1, 0.0, "2023/12/15 15:00:00", 129701, 1, 0.0, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 3, 2002, "2024/03/22 14:59:59", 10012, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", "ネフィ=ネラ", 2, 0.0, "2023/12/15 15:00:00", 129701, 2, 6.2, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 4, 2002, "2024/06/22 14:59:59", 10013, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", "カノン", 3, 0.0, "2024/03/15 15:00:00", 130301, 1, 3.1, 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 4, 2002, "2024/06/22 14:59:59", 10014, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", "カノン", 3, 0.0, "2024/03/15 15:00:00", 130301, 2, 6.15, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 4, 2002, "2024/06/22 14:59:59", 10015, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", "ナーナ", 2, 0.0, "2024/03/15 15:00:00", 130401, 1, 0.0, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 4, 2002, "2024/06/22 14:59:59", 10016, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", "ナーナ", 2, 0.0, "2024/03/15 15:00:00", 130401, 2, 3.35, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 5, 2002, "2024/09/22 14:59:59", 10017, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", "ホウオウ", 1, 0.0, "2024/06/15 15:00:00", 130502, 1, 0.0, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 5, 2002, "2024/09/22 14:59:59", 10018, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", "ホウオウ", 2, 0.0, "2024/06/15 15:00:00", 130502, 2, 3.18, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 5, 2002, "2024/09/22 14:59:59", 10019, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", "ホウオウ", 4, 0.0, "2024/06/15 15:00:00", 130503, 3, 0.0, 4);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 5, 2002, "2024/09/22 14:59:59", 10020, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", "ネア", 1, 0.0, "2024/06/15 15:00:00", 123301, 1, 4.9, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 5, 2002, "2024/09/22 14:59:59", 10021, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", "ネア", 1, 0.0, "2024/06/15 15:00:00", 123301, 2, 4.8, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 6, 2002, "2024/12/22 14:59:59", 10022, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", "カリザ", 3, 0.0, "2024/09/15 15:00:00", 133301, 1, 4.922, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 6, 2002, "2024/12/22 14:59:59", 10023, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", "カリザ", 3, 0.0, "2024/09/15 15:00:00", 133301, 2, 9.638, 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 6, 2002, "2024/12/22 14:59:59", 10024, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", "ミーア", 1, 0.0, "2024/09/15 15:00:00", 133401, 1, 2.88, 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 6, 2002, "2024/12/22 14:59:59", 10025, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", "ミーア", 5, 0.0, "2024/09/15 15:00:00", 133401, 2, 4.818, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 7, 2002, "2025/03/22 14:59:59", 10026, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", "グレイス", 2, 0.0, "2024/12/15 15:00:00", 133002, 1, 1.78, 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 7, 2002, "2025/03/22 14:59:59", 10027, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", "グレイス", 1, 0.0, "2024/12/15 15:00:00", 133002, 2, 6.15, 7);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, 7, 2002, "2025/03/22 14:59:59", 10028, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", "ヴァイオレット", 6, 0.0, "2024/12/15 15:00:00", 133102, 1, 4.28, 2);
